import { useState } from "react"
import Task from "./Task"

const Tasks = (props, onDelete) => {

    return (
        <>
            {props.task.map((task) => (
                <Task key={task.id} task={task, onDelete} />
            ))}
        </>
    )
}

export default Tasks
